function onEachFeature(feature, layer) {
    // does this feature have a property named popupContent?
    if (feature.properties && feature.properties.Zone) {
        layer.bindPopup(feature.properties.Zone+':'+feature.properties.Quarter);
    }
}

var son = L.geoJSON(data,{style:(color = "#000080"), onEachFeature: onEachFeature}).addTo(map);


     
L.easyButton('<img src="logo-button3.png">', function(btn, map){
    var url_start="http://map.land.gov.ua/kadastrova-karta/find-Parcel?cadnum=";
var cadnum=document.getElementById('map_search').value.replace(new RegExp(':','g'),'');
var koatuu=cadnum.substr(0, 10);
var zone=cadnum.substr(10, 2);
var quarter=cadnum.substr(12, 3);
var parcel=cadnum.substr(15, 4);
var s_url=url_start.concat(koatuu,":",zone,":",quarter,":",parcel,'&activeArchLayer=1')
var request = new XMLHttpRequest();
request.open('GET', s_url);
request.responseType = 'text';
request.send();
request.onload = function() {
  var ss=JSON.parse(request.response);
  xmin=ss.data[0].st_xmin;
  xmin2=JSON.stringify(xmin).replace(new RegExp('\"','g'),'');
  xmin3=parseFloat(xmin2);

  xmax=ss.data[0].st_xmax;
  xmax2=JSON.stringify(xmax).replace(new RegExp('\"','g'),'');
  xmax3=parseFloat(xmax2);

ymax=ss.data[0].st_ymax;
  ymax2=JSON.stringify(ymax).replace(new RegExp('\"','g'),'');
  ymax3=parseFloat(ymax2);

ymin=ss.data[0].st_ymin;
  ymin2=JSON.stringify(ymin).replace(new RegExp('\"','g'),'');
ymin3=parseFloat(ymin2);

x= (xmin3+xmax3)/2
y= (ymin3+ymax3)/2

var meters2degress = function(x,y) {
  var lon = x *  180 / 20037508.34 ;
  //thanks magichim @ github for the correction
  var lat = Math.atan(Math.exp(y * Math.PI / 20037508.34)) * 360 / Math.PI - 90; 
  return [lat, lon]
}

xx=meters2degress(x,y);
map.setView(xx,16);
L.marker(xx).addTo(map);   
 
}}).addTo( map);


           
      

      var baselayers = {"Карта OSM":osm}
